import React from 'react';
import './Contact.css';

function Contact() {
  return (
    <section id="contact" className="contact">
      <h2>Contact</h2>
      <p>If you'd like to get in touch, feel free to reach out on social media or send me an email.</p>
    </section>
  );
}

export default Contact;
